model_class: GPModel
input_variables:
  kHz_Hexapod_Target ypos:
    variable_class: ScalarVariable
    default_value: 0.0
    is_constant: false
    value_range: [-0.1, 0.1]
    value_range_tolerance: 1.0e-08
  kHz_Zaber_Compressor Position.Ch1:
    variable_class: ScalarVariable
    default_value: 75000.0
    is_constant: false
    value_range: [0.0, 150000.0]
    value_range_tolerance: 1.0e-08
output_variables:
  kHz_ThorlabsSpec MeanWavelength_sim_task: {variable_class: DistributionVariable,
    distribution_type: MultiVariateNormal}
  kHz_ThorlabsSpec MeanWavelength_exp_task: {variable_class: DistributionVariable,
    distribution_type: MultiVariateNormal}
input_validation_config: null
output_validation_config: null
device: cpu
precision: double
model: acave_model.pt
input_transformers: [acave_input_transformers_0.pt]
output_transformers: [acave_output_transformers_0.pt]
